import React from "react";
import {
  Grid,
  Container,
  Typography,
  Avatar,
  Divider,
  Link
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { pink } from "@material-ui/core/colors";

const useStyles = makeStyles({
  avatar: {
    margin: 10,
    width: 80,
    height: 80
  },
  avatatContainer: {
    width: "50%"
  },
  divider: {
    width: "100%",
    margin: 10
  },
  miniContainer: {
    margin: 10,
    "& div": {
      margin: "2px"
    },
    "& .MuiAvatar-root": {
      // width: 50,
      // height: 50,
      marginRight: 20,
      marginLeft: 10,
      background: pink[500],
      color: "#fff"
    }
  }
});

const ContributorsPage = () => {
  const classes = useStyles();

  return (
    <>
      <br />
      <Grid container justify="center">
        <Grid
          component={Link}
          href="https://github.com/shivamjoker"
          target="blank"
          container
          direction="column"
          alignItems="center"
          color="inherit"
          className={classes.avatatContainer}
        >
          <Avatar
            className={classes.avatar}
            src="https://avatars2.githubusercontent.com/u/23727670?s=300"
          />
          <Typography variant="h5">Shivam</Typography>
          <Typography>Creator of Ylight Music</Typography>
        </Grid>

        <Divider className={classes.divider} />
        <Typography variant="h5">Coming Soon</Typography>

        {/* <Grid container className={classes.miniContainer}>
          <Grid container alignItems="center">
            <Avatar>R</Avatar>
            <Typography variant="h6">Razvan</Typography>
          </Grid>
          <Grid container alignItems="center">
            <Avatar>S</Avatar>
            <Typography variant="h6">Shantanu</Typography>
          </Grid>
          <Grid container alignItems="center">
            <Avatar>P</Avatar>
            <Typography variant="h6">Piyush</Typography>
          </Grid>
          <Grid container alignItems="center">
            <Avatar>Z</Avatar>
            <Typography variant="h6">Zaid</Typography>
          </Grid>
        </Grid>*/}
      </Grid>
    </> 
  );
};

export default ContributorsPage;
